import React from "react";
import { NavLink } from "react-router-dom";
import SearchIcon from '@mui/icons-material/Search';



const Navbar=()=>{
    return(
        <>

        <h1 className="tio">Navbar Component </h1>

        <div className="some">
            <NavLink to="/" exact  className="listItem" activeClassName="activeItem">Home</NavLink>
            <NavLink to="/about"  className="listItem" activeClassName="activeItem">About</NavLink>
            <NavLink to="/contact" className="listItem" activeClassName="activeItem">ser</NavLink>
        </div>
        <div className="icons">
            <SearchIcon/>
        </div>

        </>
    )

}
export default Navbar;
